Mq("mutable/array.effekt",'module mutable/array\n\nimport immutable/option\nimport immutable/list\n\n// A mutable 0-based indexed array, backed by a JavaScript array.\nextern type Array[T]\n\ndef emptyArray[T](): Array[T] \x3d emptyArray(0)\n\n// Creates a new Array of size `size` filled with the value `default`\ndef fill[T](size: Int, default: T): Array[T] \x3d {\n  val arr \x3d emptyArray[T](size)\n  each(0, arr.size()) { i \x3d\x3e\n    put(arr, i, default)\n  }\n  return arr;\n}\n\n// Builds a new Array of size `size` from a computation `index` which gets an index\n// and returns a value that will be on that position in the resulting array\ndef build[T](size: Int) { index: Int \x3d\x3e T }: Array[T] \x3d {\n  val arr \x3d emptyArray[T](size)\n  each(0, arr.size()) { i \x3d\x3e\n    put(arr, i, index(i))\n  }\n  return arr\n}\n\n// Converts a List `list` to an Array\ndef fromList[T](list: List[T]): Array[T] \x3d {\n  val listSize \x3d list.size();\n  val arr \x3d emptyArray(listSize);\n\n  foreachIndex(list) { (i, head) \x3d\x3e\n    put(arr, i, head)\n  }\n  return arr;\n}\n\nextern pure def emptyArray[T](initialSize: Int): Array[T] \x3d\n  "(new Array(${initialSize}))"\n\ndef get[T](arr: Array[T], index: Int): Option[T] \x3d\n  arr.unsafeGet(index).undefinedToOption\n\nextern pure def size[T](arr: Array[T]): Int \x3d\n  "${arr}.length"\n\nextern io def unsafeGet[T](arr: Array[T], index: Int): T \x3d\n  "${arr}[${index}]"\n\nextern !!!MULTILINEMARKER!!!\nfunction put(arr, index, value) {\n  arr[index] \x3d value;\n  return $effekt.unit\n}\n!!!MULTILINEMARKER!!!\n\nextern io def put[T](arr: Array[T], index: Int, value: T): Unit \x3d\n  "put(${arr}, ${index}, ${value})"\n\nextern pure def copy[T](arr: Array[T]): Array[T] \x3d\n  "[...${arr}]"\n\n// Utility functions:\n\ndef toList[T](arr: Array[T]): List[T] \x3d {\n  var i \x3d arr.size - 1;\n  var l \x3d Nil[T]()\n  while (i \x3e\x3d 0) {\n    l \x3d Cons(unsafeGet(arr, i), l)\n    i \x3d i - 1\n  }\n  l\n}\n\ndef foreach[T](arr: Array[T]){ action: T \x3d\x3e Unit / Control }: Unit \x3d {\n  each(0, arr.size) { i \x3d\x3e\n    val x: T \x3d arr.unsafeGet(i)\n    action(x)\n  }\n}\n\ndef foreachIndex[T](arr: Array[T]){ action: (Int, T) \x3d\x3e Unit / Control }: Unit \x3d {\n  each(0, arr.size) { i \x3d\x3e\n    val x: T \x3d arr.unsafeGet(i)\n    action(i, x)\n  }\n}\n\ndef sum(list: Array[Int]): Int \x3d {\n  var acc \x3d 0\n  list.foreach { x \x3d\x3e\n    acc \x3d acc + x\n  }\n  acc\n}\n');
Mq("immutable/result.effekt",'import immutable/option\n\n// Results\n// \x3d\x3d\x3d\x3d\x3d\x3d\x3d\n// The "reification" of the Exception[E] effect.\ntype Result[A, E] {\n  Error(exception: E, msg: String);\n  Success(a: A)\n}\n\ndef result[A, E] { f: () \x3d\x3e A / Exception[E] }: Result[A, E] \x3d try {\n  Success(f())\n} with Exception[E] {\n  def raise(exc, msg) \x3d Error(exc, msg)\n}\n\n/**\n * Extracts the value of a result, if available\n * Monadic "reflection"\n */\ndef value[A, E](r: Result[A, E]): A / Exception[E] \x3d r match {\n  case Success(a) \x3d\x3e a\n  case Error(exc, msg) \x3d\x3e do raise(exc, msg)\n}\n\ndef toOption[A, E](r: Result[A, E]): Option[A] \x3d r match {\n  case Success(a) \x3d\x3e Some(a)\n  case Error(exc, msg) \x3d\x3e None()\n}');
Mq("immutable/dequeue.effekt","module immutable/dequeue\n\nimport immutable/list\nimport immutable/option\n\n// An implementation of a functional dequeue, using Okasaki's\n// bankers dequeue implementation.\n//\n// Translation from the Haskell implementation:\n//   https://hackage.haskell.org/package/dequeue-0.1.12/docs/src/Data-Dequeue.html#Dequeue\nrecord Dequeue[R](front: List[R], frontSize: Int, rear: List[R], rearSize: Int)\n\ndef emptyQueue[R](): Dequeue[R] \x3d Dequeue(Nil(), 0, Nil(), 0)\n\ndef isEmpty[R](dq: Dequeue[R]): Boolean \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e (fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 0)\n}\n\ndef size[R](dq: Dequeue[R]): Int \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e fs + rs\n}\n\ndef first[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 1)) { r.headOption }\n      else { f.headOption }\n}\n\ndef last[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 1) \x26\x26 (rs \x3d\x3d 0)) { f.headOption }\n      else { r.headOption }\n}\n\ndef check[R](dq: Dequeue[R]): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n        val c \x3d 4;\n        val size1 \x3d (fs + rs) / 2;\n        val size2 \x3d (fs + rs) - size1;\n\n        if (fs \x3e c * rs + 1) {\n            val front \x3d f.take(size1);\n            val rear \x3d r.append(f.drop(size1).reverse);\n            Dequeue(front, size1, rear, size2)\n        } else if (rs \x3e c * fs + 1) {\n            val front \x3d f.append(r.drop(size1).reverse);\n            val rear \x3d r.take(size1);\n            Dequeue(front, size2, rear, size1)\n        } else {\n            dq\n        }\n}\n\ndef pushFront[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(Cons(el, f), fs + 1, r, rs).check\n}\n\ndef popFront[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Nil(), fs, Cons(x, Nil()), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(Nil(), fs, r, rs) \x3d\x3e\n        None()\n    case Dequeue(Cons(x, rest), fs, r, rs) \x3d\x3e\n        Some((x, Dequeue(rest, fs - 1, r, rs).check))\n}\n\ndef pushBack[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(f, fs, Cons(el, r), rs + 1).check\n}\n\ndef popBack[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Cons(x, Nil()), fs, Nil(), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(f, fs, Nil(), rs) \x3d\x3e\n        None()\n    case Dequeue(f, fs, Cons(x, rest), rs) \x3d\x3e\n        Some((x, Dequeue(f, fs, rest, rs - 1).check))\n}\n");
Mq("immutable/option.effekt","module immutable/option\n\nimport effekt\n\ntype Option[A] {\n  None();\n  Some(value: A)\n}\n\ndef isDefined[A](self: Option[A]): Boolean \x3d self match {\n  case None()  \x3d\x3e false\n  case Some(v) \x3d\x3e true\n}\n\ndef isEmpty[A](self: Option[A]): Boolean \x3d\n  self.isDefined.not\n\ndef orElse[A](self: Option[A]) { that: \x3d\x3e Option[A] }: Option[A] \x3d self match {\n  case None()  \x3d\x3e that()\n  case Some(v) \x3d\x3e Some(v)\n}\n\ndef getOrElse[A](self: Option[A]) { that: \x3d\x3e A }: A \x3d self match {\n  case None() \x3d\x3e that()\n  case Some(v) \x3d\x3e v\n}\n\ndef map[A, B](self: Option[A]) { f: A \x3d\x3e B }: Option[B] \x3d self match {\n  case None()  \x3d\x3e None()\n  case Some(v) \x3d\x3e Some(f(v))\n}\n\ndef foreach[A](self: Option[A]) { f: A \x3d\x3e Unit }: Unit \x3d self match {\n  case None()  \x3d\x3e ()\n  case Some(v) \x3d\x3e f(v)\n}\n\n// Interop with JS\n// ---------------\n// These functions should only be used by libraries that interface with native JS\n\ndef undefinedToOption[A](value: A): Option[A] \x3d\n  if (value.isUndefined) { None() } else { Some(value) }\n\ndef nullToOption[A](value: A): Option[A] \x3d\n  if (value.isNull) { None() } else { Some(value) }\n\ndef nullishToOption[A](value: A): Option[A] \x3d\n  if (value.isUndefined || value.isNull) { None() } else { Some(value) }\n");
Mq("immutable/list.effekt",'module immutable/list\n\nimport effekt\nimport immutable/option\n\n// Used as a type for `Exception` in functions which expect a nonempty list.\nrecord EmptyList()\n\n// Used as a type for `Exception` in functions where an index can be out of bounds.\nrecord OutOfBounds()\n\n// Immutable linked list for finite sequences of elements.\ntype List[A] {\n  Nil();\n  Cons(head: A, tail: List[A])\n}\n\n// Create an empty list.\n//\n// O(1)\ndef empty[A](): List[A] \x3d Nil()\n\n// Create a list with one element.\n//\n// O(1)\ndef singleton[A](x: A): List[A] \x3d Cons(x, Nil())\n\n// Create a list of length `size` where all elements are `default`.\n//\n// O(size)\ndef fill[A](size: Int, default: A): List[A] \x3d {\n  build(size) { i \x3d\x3e default }\n}\n\n// Create a list from a function `index` of given `size`.\n//\n// O(size)\ndef build[A](size: Int) { index: Int \x3d\x3e A }: List[A] \x3d {\n  var result \x3d empty()\n  each(0, size) { i \x3d\x3e\n    result \x3d Cons(index(i), result)\n  }\n  result.reverse\n}\n\n// Check if list is empty.\n//\n// O(1)\ndef isEmpty[A](l: List[A]): Boolean \x3d l match {\n  case Nil() \x3d\x3e true\n  case Cons(a, rest) \x3d\x3e false\n}\n\n// Check if list is nonempty.\n//\n// O(1)\ndef nonEmpty[A](l: List[A]): Boolean \x3d l match {\n  case Nil() \x3d\x3e false\n  case Cons(a, rest) \x3d\x3e true\n}\n\n// Return the first element of a given list.\n// Throws a `EmptyList` exception if it\'s empty.\n//\n// O(1)\ndef head[A](l: List[A]): A / Exception[EmptyList] \x3d l match {\n  case Nil() \x3d\x3e do raise(EmptyList(), "Trying to get the head of an empty list")\n  case Cons(a, rest) \x3d\x3e a\n}\n\n// Return all elements of a given list except the first element.\n// Throws a `EmptyList` exception if it\'s empty.\n//\n// O(1)\ndef tail[A](l: List[A]): List[A] / Exception[EmptyList] \x3d l match {\n  case Nil() \x3d\x3e do raise(EmptyList(), "Trying to get the head of an empty list")\n  case Cons(a, rest) \x3d\x3e rest\n}\n\n// Return the first element of a given list.\n// Returns `None()` if it\'s empty.\n//\n// O(1)\ndef headOption[A](l: List[A]): Option[A] \x3d l match {\n  case Nil() \x3d\x3e None()\n  case Cons(a, rest) \x3d\x3e Some(a)\n}\n\n// Get the value at given index.\n//\n// O(N)\ndef get[A](list: List[A], index: Int): A / Exception[OutOfBounds] \x3d {\n  def go(list: List[A], i: Int): A / Exception[OutOfBounds] \x3d {\n    list match {\n      case Nil() \x3d\x3e do raise(OutOfBounds(), "Trying to get an element outside the bounds of a list")\n      case Cons(x, xs) \x3d\x3e\n        if (i \x3d\x3d 0) {\n          x\n        } else {\n          go(xs, i - 1)\n        }\n    }\n  }\n\n  go(list, index)\n}\n\n// Traverse a list, applying the given action on every element.\n//\n// O(N)\ndef foreach[A](l: List[A]) { f: A \x3d\x3e Unit / Control } : Unit \x3d {\n  var remainder \x3d l\n  loop {\n    if (not(remainder.isEmpty)) {\n      remainder match {\n        case Nil() \x3d\x3e ()\n        case Cons(a, as) \x3d\x3e\n          remainder \x3d as\n          f(a)\n      }\n    } else { do break() }\n  }\n}\n\n// Traverse a list, applying the given action on every element and its (zero-based) index.\n//\n// O(N)\ndef foreachIndex[A](list: List[A]){ f: (Int, A) \x3d\x3e Unit / Control }: Unit \x3d {\n  var remainder \x3d list\n  var i \x3d -1\n  loop {\n    if (not(remainder.isEmpty)) {\n      remainder match {\n        case Nil() \x3d\x3e ()\n        case Cons(a, as) \x3d\x3e\n          remainder \x3d as\n          i \x3d i + 1\n          f(i, a)\n      }\n    } else { do break() }\n  }\n}\n\n// Map a function `f` over elements in a given list.\n//\n// O(N)\ndef map[A, B](l: List[A]) { f: A \x3d\x3e B } : List[B] \x3d {\n  var acc \x3d Nil[B]()\n  l.foreach { el \x3d\x3e acc \x3d Cons(f(el), acc) }\n  acc.reverse\n}\n\n// Map a function `f` over elements in a given list,\n// keeping only the elements for which the function returned `Some(...)`,\n// discarding the elements for which the function returned `None()`.\n//\n// O(N)\ndef collect[A, B](l: List[A]) { f : A \x3d\x3e Option[B] }: List[B] \x3d {\n  var acc \x3d Nil[B]()\n  l.foreach { a \x3d\x3e\n    val optB \x3d f(a)\n    optB match {\n      case None() \x3d\x3e ();\n      case Some(b) \x3d\x3e acc \x3d Cons(b, acc);\n    }\n  }\n  acc.reverse\n}\n\n// Map a function `f` over elements in a given list and concatenate the results.\n//\n// O(N)\ndef flatMap[A, B](l: List[A]) { f : A \x3d\x3e List[B] }: List[B] \x3d {\n  var acc \x3d Nil[B]()\n  l.foreach { a \x3d\x3e\n    val bs \x3d f(a)\n    acc \x3d acc.append(bs)\n  }\n  acc\n}\n\n// Check if predicate is true for all elements of the given list.\n//\n// O(N)\ndef all[A](list: List[A]) { predicate: A \x3d\x3e Boolean }: Boolean \x3d {\n  list match {\n    case Cons(x, xs) \x3d\x3e predicate(x) \x26\x26 all(xs) { predicate }\n    case Nil() \x3d\x3e true\n  }\n}\n\n// Check if predicate is true for at least one element of the given list.\n//\n// O(N)\ndef any[A](list: List[A]) { predicate: A \x3d\x3e Boolean }: Boolean \x3d {\n  list match {\n    case Cons(x, xs) \x3d\x3e predicate(x) || any(xs) { predicate }\n    case Nil() \x3d\x3e false\n  }\n}\n\n// Sum the elements of the list.\n//\n// O(N)\ndef sum(list: List[Int]): Int \x3d {\n  var n \x3d 0;\n  list.foreach { x \x3d\x3e n \x3d n + x };\n  n\n}\n\n// Calculate the size of the list.\n//\n// O(N)\ndef size[A](l: List[A]): Int \x3d {\n  var n \x3d 0;\n  l.foreach { _ \x3d\x3e n \x3d n + 1 };\n  n\n}\n\n// Reverse the list.\n//\n// O(N)\ndef reverse[A](l: List[A]): List[A] \x3d {\n  var res \x3d Nil[A]()\n  l.foreach { el \x3d\x3e res \x3d Cons(el, res) }\n  res\n}\n\n// Reverse a list `l` and append `other` to it.\n//\n// Example:\n// ```\n// \x3e [1,2,3].reverseOnto([4,5,6])\n// [3,2,1,4,5,6]\n// ```\n//\n// O(|l|)\ndef reverseOnto[A](l: List[A], other: List[A]): List[A] \x3d l match {\n  case Nil() \x3d\x3e other\n  case Cons(a, rest) \x3d\x3e rest.reverseOnto(Cons(a, other))\n}\n\n// Concatenate list `l` with list `other`:\n//\n// Example:\n// ```\n// \x3e [1,2,3].append([4,5,6])\n// [1,2,3,4,5,6]\n// ```\n//\n// O(N)\ndef append[A](l: List[A], other: List[A]): List[A] \x3d\n  l.reverse.reverseOnto(other)\n\n// Flatten a list of lists into a single list.\n//\n// Examples:\n// ```\n// \x3e [[1, 2, 3], [4, 5], [6]].join()\n// [1, 2, 3, 4, 5, 6]\n//\n// \x3e [[]].join()\n// []\n// ```\n//\n// O(N)\ndef join[A](lists: List[List[A]]): List[A] \x3d {\n  var acc: List[A] \x3d Nil()\n  lists.foreach { list \x3d\x3e\n    acc \x3d acc.append(list)\n  }\n  acc\n}\n\n// Flatten a list of lists into a single list,\n// putting the `between` list in between each list in the input.\n//\n// Examples:\n// ```\n// \x3e [[100], [200, 300], [400]].join([1, 2, 3])\n// [100, 1, 2, 3, 200, 300, 1, 2, 3, 400]\n//\n// \x3e [[]].join([1, 2, 3])\n// []\n// ```\n//\n// O(N)\ndef join[A](lists: List[List[A]], between: List[A]): List[A] \x3d {\n  lists match {\n    case Nil() \x3d\x3e Nil()\n    case Cons(firstList, restOfLists) \x3d\x3e\n      firstList.append(\n        restOfLists.flatMap { list \x3d\x3e between.append(list)}\n      )\n  }\n}\n\n// Take the first `n` elements of a given list.\n//\n// Examples:\n// ```\n// \x3e [1, 2, 3].take(2)\n// [1, 2]\n//\n// \x3e [1, 2, 3].take(0)\n// []\n//\n// \x3e [1, 2, 3].take(3)\n// [1, 2, 3]\n//\n// \x3e [1, 2, 3].take(5)\n// [1, 2, 3]\n//\n// \x3e [1, 2, 3].take(-1)\n// []\n// ```\n//\n// O(n)\ndef take[A](l: List[A], n: Int): List[A] \x3d\n  if (n \x3c\x3d 0) {\n    Nil()\n  } else l match {\n    case Nil() \x3d\x3e Nil()\n    case Cons(a, rest) \x3d\x3e Cons(a, rest.take(n - 1))\n  }\n\n// Drop the first `n` elements of a given list.\n//\n// Examples:\n// ```\n// \x3e [1, 2, 3].drop(2)\n// [3]\n//\n// \x3e [1, 2, 3].drop(0)\n// [1, 2, 3]\n//\n// \x3e [1, 2, 3].drop(3)\n// []\n//\n// \x3e [1, 2, 3].drop(5)\n// []\n//\n// \x3e [1, 2, 3].drop(-1)\n// [1, 2, 3]\n// ```\n//\n// O(n)\ndef drop[A](l: List[A], n: Int): List[A] \x3d\n  if (n \x3c\x3d 0) {\n    l\n  } else l match {\n    case Nil() \x3d\x3e Nil()\n    case Cons(a, rest) \x3d\x3e rest.drop(n - 1)\n  }\n\n// Return a slice of a given list from the starting index (inclusive)\n// to the given end index (exclusive).\n//\n// Examples:\n// ```\n// \x3e [1, 2, 3, 4, 5, 6].slice(1, 4)\n// [2, 3, 4]\n//\n// \x3e [1, 2, 3, 4, 5, 6].slice(1, 2)\n// [2]\n//\n// \x3e [1, 2, 3, 4, 5, 6].slice(1, 1)\n// []\n//\n// \x3e [1, 2, 3, 4, 5, 6].slice(4, 1)\n// []\n//\n// \x3e [1, 2, 3, 4, 5, 6].slice(-100, 100)\n// [1, 2, 3, 4, 5, 6]\n// ```\n//\n// O(N)\ndef slice[A](list: List[A], start: Int, stopExclusive: Int): List[A] \x3d {\n  val prefix \x3d list.drop(start)\n  val length \x3d stopExclusive - start\n  prefix.take(length)\n}\n\n// Split the list at given index.\n//\n// Law: `val (l, r) \x3d list.splitAt(i); l.append(r) \x3d\x3d\x3d list`\n//\n// O(N)\ndef splitAt[A](list: List[A], index: Int): (List[A], List[A]) \x3d {\n  (list.take(index), list.drop(index))\n}\n\n// Update the element at given index in the list using the `update` function.\n// Returns the original list if the index is out of bounds.\n//\n// See: `modifyAt`\n// Examples:\n// ```\n// \x3e [1, 2, 3].updateAt(1) { n \x3d\x3e n + 100 }\n// [1, 102, 3]\n//\n// \x3e [1, 2, 3].updateAt(10) { n \x3d\x3e n + 100 }\n// [1, 2, 3]\n// ```\n//\n// O(N)\ndef updateAt[A](list: List[A], index: Int) { update: A \x3d\x3e A }: List[A] \x3d {\n  list.splitAt(index) match {\n    case (left, Cons(x, right)) \x3d\x3e\n      left.append(Cons(update(x), right))\n    case _ \x3d\x3e list\n  }\n}\n\n// Modify the element at given index in the list using the `update` function.\n// Throws `OutOfBounds` if the index is out of bounds.\n//\n// See: `updateAt`\n// Examples:\n// ```\n// \x3e [1, 2, 3].modifyAt(1) { n \x3d\x3e n + 100 }\n// Some([1, 102, 3])\n//\n// \x3e [1, 2, 3].modifyAt(10) { n \x3d\x3e n + 100 }\n// None()\n// ```\n//\n// O(N)\ndef modifyAt[A](list: List[A], index: Int) { update: A \x3d\x3e A }: List[A] / Exception[OutOfBounds] \x3d {\n  list.splitAt(index) match {\n    case (left, Cons(x, right)) \x3d\x3e\n      left.append(Cons(update(x), right))\n    case _ \x3d\x3e do raise(OutOfBounds(), "Trying to modify an element outside the bounds of a list")\n  }\n}\n\n// Delete the element at given index in the list.\n//\n// Example:\n// ```\n// \x3e [1, 2, 3, 4].deleteAt(1)\n// [1, 3, 4]\n//\n// \x3e [1, 2, 3, 4].deleteAt(-1)\n// [1, 2, 3, 4]\n//\n// \x3e [1, 2, 3, 4].deleteAt(10)\n// [1, 2, 3, 4]\n// ```\n//\n// O(N)\ndef deleteAt[A](list: List[A], index: Int): List[A] \x3d {\n  val left \x3d list.slice(0, index)\n  val right \x3d list.slice(index + 1, list.size())\n  left.append(right)\n}\n\n// Add an element at given index in the list.\n//\n// Examples:\n// ```\n// \x3e [1, 2, 3].insert(-1, 0)\n// [0, 1, 2, 3]\n//\n// \x3e [1, 2, 3].insert(0, 0)\n// [0, 1, 2, 3]\n//\n// \x3e [1, 2, 3].insert(1, 0)\n// [1, 0, 2, 3]\n//\n// \x3e [1, 2, 3].insert(3, 0)\n// [1, 2, 3, 0]\n//\n// \x3e [1, 2, 3].insert(10, 0)\n// [1, 2, 3, 0]\n// ```\n//\n// O(N)\ndef insert[A](list: List[A], index: Int, x: A): List[A] \x3d {\n  val (left, right) \x3d list.splitAt(index)\n  left.append(Cons(x, right))\n}\n\n// Replace an element at given index in the list.\n// Returns the original list when the index is out of bounds.\n//\n// Examples:\n// ```\n// \x3e [1, 2, 3].replace(0, 42)\n// [42, 2, 3]\n//\n// \x3e [1, 2, 3].replace(-1, 42)\n// [1, 2, 3]\n//\n// \x3e [1, 2, 3].replace(10, 42)\n// [1, 2, 3]\n// ```\n//\n// O(N)\ndef replace[A](list: List[A], index: Int, x: A): List[A] \x3d {\n  if (index \x3c 0 || index \x3e\x3d list.size()) {\n    list\n  } else {\n    val left \x3d list.take(index)\n    val right \x3d list.drop(index + 1)\n    left.append(Cons(x, right))\n  }\n}\n\n// Produce a list of pairs from a pair of lists.\n// The length of the result is the minimum of lengths of the two lists.\n//\n// Examples:\n// ```\n// \x3e zip([1, 2, 3], [100, 200, 300])\n// [(1, 100), (2, 200), (3, 300)]\n//\n// \x3e zip([1, 2, 3], Nil[Int]())\n// []\n//\n// \x3e zip(Nil[Int](), [1, 2, 3])\n// []\n//\n// \x3e zip([1, 2, 3], [42])\n// [(1, 42)]\n// ```\n//\n// O(N)\ndef zip[A, B](left: List[A], right: List[B]): List[(A, B)] \x3d {\n  def go(acc: List[(A, B)], left: List[A], right: List[B]): List[(A, B)] \x3d {\n    (left, right) match {\n      case (Cons(a, as), Cons(b, bs)) \x3d\x3e\n        val pair \x3d (a, b)\n        val newAcc \x3d Cons(pair, acc)\n        go(newAcc, as, bs)\n      case _ \x3d\x3e acc.reverse\n    }\n  }\n  go(Nil(), left, right)\n}\n\n// Combine two lists with the given function.\n// The length of the result is the minimum of lengths of the two lists.\n//\n// Examples:\n// ```\n// \x3e zipWith([1, 2, 3], [100, 200, 300]) { (a, b) \x3d\x3e a + b }\n// [101, 202, 303]\n//\n// \x3e zipWith([1, 2, 3], Nil[Int]()) { (a, b) \x3d\x3e a + b }\n// []\n//\n// \x3e zipWith(Nil[Int](), [1, 2, 3]) { (a, b) \x3d\x3e a + b }\n// []\n//\n// \x3e zipWith([1, 2, 3], [42]) { (a, b) \x3d\x3e a + b }\n// [43]\n// ```\n//\n// O(N)\ndef zipWith[A, B, C](left: List[A], right: List[B]) { combine : (A, B) \x3d\x3e C }: List[C] \x3d {\n  def go(acc: List[C], left: List[A], right: List[B]): List[C] \x3d {\n    (left, right) match {\n      case (Cons(a, as), Cons(b, bs)) \x3d\x3e\n        val result \x3d combine(a, b)\n        val newAcc \x3d Cons(result, acc)\n        go(newAcc, as, bs)\n      case _ \x3d\x3e acc.reverse\n    }\n  }\n  go(Nil(), left, right)\n}\n\n// Produce a pair of lists from a list of pairs.\n//\n// Examples:\n// ```\n// \x3e [(1, 100), (2, 200), (3, 300)].unzip()\n// ([1, 2, 3], [100, 200, 300])\n// ```\n//\n// O(N)\ndef unzip[A, B](pairs: List[(A, B)]): (List[A], List[B]) \x3d {\n  pairs match {\n    case Nil() \x3d\x3e (Nil(), Nil())\n    case Cons((l, r), rest) \x3d\x3e\n      val (left, right) \x3d rest.unzip();\n      (Cons(l, left), Cons(r, right))\n  }\n}\n\n// Partition a given list into two lists.\n// The left list contains the elements that satsify the predicate,\n// the right list contains the elements that do not.\n//\n// O(N)\ndef partition[A](l: List[A]) { pred: A \x3d\x3e Boolean }: (List[A], List[A]) \x3d {\n  var lefts: List[A] \x3d Nil()\n  var rights: List[A] \x3d Nil()\n  l.foreach { el \x3d\x3e\n    if (pred(el)) {\n      lefts \x3d Cons(el, lefts)\n    } else {\n      rights \x3d Cons(el, rights)\n    }\n  }\n\n  (lefts.reverse, rights.reverse)\n}\n\n// Sort a list using a given comparison function.\n//\n// Note: this implementation is not stacksafe!\n//\n// O(N log N)\ndef sortBy[A](l: List[A]) { compare: (A, A) \x3d\x3e Boolean }: List[A] \x3d\n  l match {\n    case Nil() \x3d\x3e Nil()\n    case Cons(pivot, rest) \x3d\x3e\n      val (lt, gt) \x3d rest.partition { el \x3d\x3e compare(el, pivot) };\n      val leftSorted \x3d sortBy(lt) { (a, b) \x3d\x3e compare(a, b) }\n      val rightSorted \x3d sortBy(gt) { (a, b) \x3d\x3e compare(a, b) }\n      leftSorted.append(Cons(pivot, rightSorted))\n  }\n\ndef sort(l: List[Int]): List[Int] \x3d l.sortBy { (a, b) \x3d\x3e a \x3c b }\ndef sort(l: List[Double]): List[Double] \x3d l.sortBy { (a, b) \x3d\x3e a \x3c b }\n\n// Check if a list is sorted according to the given comparison function.\n//\n// O(N)\ndef isSortedBy[A](list: List[A]) { compare: (A, A) \x3d\x3e Boolean }: Boolean \x3d {\n  def go(list: List[A]): Boolean \x3d {\n    list match {\n      case Nil() \x3d\x3e true\n      case Cons(x, Nil()) \x3d\x3e true\n      case Cons(x, Cons(y, rest)) \x3d\x3e\n        val next \x3d Cons(y, rest) // Future work: Replace this by an @-pattern!\n        compare(x, y) \x26\x26 go(next)\n    }\n  }\n  go(list)\n}');
